import React from "react";

const Paginado = ({paginado , pokexPagina , pokemons}) => {

    let arrayPoke = [];

    for (i = 1; i<= Math.ceil(pokemons/pokexPagina); i++){
        arrayPoke.push(i)
    }

    return (
        <ul>
            {
                arrayPoke.map()
            }
        </ul>
    )
}

export default Paginado
